import {
  FormControl,
  InputLabel,
  Select,
  MenuItem,
  IconButton,
} from "@mui/material";
import LoanIconButton from "../../../../Common/LoanIconButton";
import CompanyModal from "../../../Common/CompanyModal";
// import CompanyModal from "../../../../Common/CompanyModal";
import { RiSkipBackMiniFill } from "react-icons/ri";
import { BsPlus } from "react-icons/bs";
import { BiSkipNext, BiSkipPrevious } from "react-icons/bi";
import { useState } from "react";
import { IoRefresh } from "react-icons/io5";
// import LoanTextField from "../../../Common/LoanTextField";
import CommonServices from "../../Common/CommonServices";
import LoanTextField from "../../../../Common/LoanTextField";
const ViewPreshipmentFacility = ({
  submitted,
  handleBack,
  handleSkip,
  handleNext,
  handleInputChangePreshipmentFacility,
  savePreshipmentFacility,
  preshipmentFacilitys,
  setPreshipmentFacilitys,
}) => {
  const [isCreditPerformanceModalOpen, setIsCreditPerformanceModalOpen] =
    useState(false);
  function handleCreditPerformanceOpenModal() {
    setIsCreditPerformanceModalOpen(true);
  }
  function handlCreditPerformanceCloseModal() {
    setIsCreditPerformanceModalOpen(false);
  }
  const [approvalDate, setApprovalDate] = useState(new Date());
  const [startDate, setStartDate] = useState(new Date());
  const [maturityDate, setMaturityDate] = useState(new Date());
  const [salesContractDate, setSalesContractDate] = useState(new Date());
  const [shipmentDate, setShipmentDate] = useState(new Date());
  const [lOT1ShipmentDate, setLOT1ShipmentDate] = useState(new Date());
  const [LOT1IncomingDate, setLOT1IncomingDate] = useState(new Date());
  const [currency, setCurrency] = useState([]);
  const getCurrency = () => {
    CommonServices.getCurrency()
      .then((response) => {
        setCurrency(response.data.Result);
        console.log(response.data.Result);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  useEffect(() => {
    getCurrency();
  }, []);
  return (
    <>
      <div className="flex">
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BiSkipPrevious />}
          text="Back"
          onClick={handleSkip}
        />
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BsPlus />}
          text="Add"
          onClick={handleCreditPerformanceOpenModal}
        />
        <LoanIconButton
          style={{ color: "purple" }}
          icon={<BiSkipNext />}
          text="Skip"
          onClick={handleSkip}
        />
      </div>
      <CompanyModal
        isOpen={isCreditPerformanceModalOpen}
        onClose={handlCreditPerformanceCloseModal}
        title="Add preshipment "
      >
        <div>
          <div className="relative center justify-center flex-1 w-full max-w-full grid grid-cols-1 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-4">
            <LoanTextField
              id="ApprovedFacilityLimit"
              label="ApprovedFacilityLimit"
              value={preshipmentFacilitys.ApprovedFacilityLimit}
              onChange={handleInputChangePreshipmentFacility}
              name="ApprovedFacilityLimit"
            />
            <LoanTextField
              id="TypesOfGoods"
              label="TypesOfGoods"
              value={preshipmentFacilitys.TypesOfGoods}
              onChange={handleInputChangePreshipmentFacility}
              name="TypesOfGoods"
            />
            <p>
              Start Date:
              <input
                id="StartDate"
                name="StartDate"
                label="StartDate"
                placeholder="StartDate"
                type="date"
                value={
                  startDate.getFullYear().toString() +
                  "-" +
                  (startDate.getMonth() + 1).toString().padStart(2, 0) +
                  "-" +
                  startDate.getDate().toString().padStart(2, 0)
                }
                onChange={(e) => {
                  setStartDate(new Date(e.target.value));
                  preshipmentFacilitys.StartDate = startDate;
                }}
              />{" "}
            </p>
            <p>
              Maturity Date:
              <input
                id="MaturityDate"
                name="MaturityDate"
                label="MaturityDate"
                placeholder="MaturityDate"
                type="date"
                value={
                  maturityDate.getFullYear().toString() +
                  "-" +
                  (maturityDate.getMonth() + 1).toString().padStart(2, 0) +
                  "-" +
                  maturityDate.getDate().toString().padStart(2, 0)
                }
                onChange={(e) => {
                  setMaturityDate(new Date(e.target.value));
                  preshipmentFacilitys.MaturityDate = maturityDate;
                }}
              />{" "}
            </p>
            <LoanTextField
              id="SalesContractVersion"
              label="SalesContractVersion"
              value={preshipmentFacilitys.SalesContractVersion}
              onChange={handleInputChangePreshipmentFacility}
              name="SalesContractVersion"
            />
            <LoanTextField
              id="SalesContractDocument"
              label="SalesContractDocument"
              value={preshipmentFacilitys.SalesContractDocument}
              onChange={handleInputChangePreshipmentFacility}
              name="SalesContractDocument"
            />
            <p>
              Sales Contract Date:
              <input
                id="SalesContractDate"
                name="SalesContractDate"
                label="SalesContractDate"
                placeholder="SalesContractDate"
                type="date"
                value={
                  salesContractDate.getFullYear().toString() +
                  "-" +
                  (salesContractDate.getMonth() + 1).toString().padStart(2, 0) +
                  "-" +
                  salesContractDate.getDate().toString().padStart(2, 0)
                }
                onChange={(e) => {
                  setSalesContractDate(new Date(e.target.value));
                  preshipmentFacilitys.SalesContractDate = salesContractDate;
                }}
              />{" "}
            </p>
            {/* SectorTypeId

            CurrencyId */}
            <FormControl variant="standard" sx={{ minWidth: 120 }}>
              <InputLabel id="CurrencyId" color="secondary">
                Currency{" "}
              </InputLabel>
              <Select
                color="secondary"
                onChange={(event) => {
                  preshipmentFacilitys.CurrencyId = event.target.value;
                  // setCurrencyId(event.target.value);
                }}
                labelId="CurrencyId"
                id="CurrencyId"
                label="CurrencyId"
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                {currency.map((yourCurrency) => (
                  <MenuItem
                    key={yourCurrency.Id}
                    CurrencyId={yourCurrency.Id}
                    value={yourCurrency.Id}
                  >
                    {yourCurrency.Name}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
            <LoanTextField
              id="ContractValue"
              label="ContractValue"
              value={preshipmentFacilitys.ContractValue}
              onChange={handleInputChangePreshipmentFacility}
              name="ContractValue"
            />
            <p>
              Shipment Date:
              <input
                id="ShipmentDate"
                name="ShipmentDate"
                label="ShipmentDate"
                placeholder="ShipmentDate"
                type="date"
                value={
                  shipmentDate.getFullYear().toString() +
                  "-" +
                  (shipmentDate.getMonth() + 1).toString().padStart(2, 0) +
                  "-" +
                  shipmentDate.getDate().toString().padStart(2, 0)
                }
                onChange={(e) => {
                  setShipmentDate(new Date(e.target.value));
                  preshipmentFacilitys.ShipmentDate = shipmentDate;
                }}
              />{" "}
            </p>
            {/* CountryId  here*/}
            <FormControl variant="standard" sx={{ minWidth: 120 }}>
              <InputLabel id="CountryId" color="secondary">
                country{" "}
              </InputLabel>
              <Select
                color="secondary"
                onChange={(event) => {
                  preshipmentFacilitys.CountryId = event.target.value;
                  // setCurrencyId(event.target.value);
                }}
                labelId="CurrencyId"
                id="CurrencyId"
                label="CurrencyId"
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                {currency.map((yourCurrency) => (
                  <MenuItem
                    key={yourCurrency.Id}
                    CurrencyId={yourCurrency.Id}
                    value={yourCurrency.Id}
                  >
                    {yourCurrency.Name}
                  </MenuItem>
                ))}
              </Select>
            </FormControl>
            {/* IsPartialShipmentAllowed */}
            <FormControl variant="standard" sx={{ minWidth: 120 }}>
              <InputLabel id="IsPartialShipmentAllowed" color="secondary">
                IsPartialShipmentAllowed{" "}
              </InputLabel>
              <Select
                color="secondary"
                onChange={(event) => {
                  preshipmentFacilitys.IsPartialShipmentAllowed =
                    event.target.value;
                  // setLoanTypeId(event.target.value);
                }}
                labelId="IsPartialShipmentAllowed"
                id="IsPartialShipmentAllowed"
                label="IsPartialShipmentAllowed"
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                <MenuItem value="1">
                  <em>yes</em>
                </MenuItem>
                <MenuItem value="0">
                  <em>No</em>
                </MenuItem>
              </Select>
            </FormControl>

            {/* IsLOTDefined */}
            <FormControl variant="standard" sx={{ minWidth: 120 }}>
              <InputLabel id="IsLOTDefined" color="secondary">
                IsLOTDefined{" "}
              </InputLabel>
              <Select
                color="secondary"
                onChange={(event) => {
                  preshipmentFacilitys.IsLOTDefined = event.target.value;
                  // setLoanTypeId(event.target.value);
                }}
                labelId="IsLOTDefined"
                id="IsLOTDefined"
                label="IsLOTDefined"
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                <MenuItem value="1">
                  <em>yes</em>
                </MenuItem>
                <MenuItem value="0">
                  <em>No</em>
                </MenuItem>
              </Select>
            </FormControl>
            <LoanTextField
              id="LOT1Value"
              label="LOT1Value"
              value={preshipmentFacilitys.LOT1Value}
              onChange={handleInputChangePreshipmentFacility}
              name="LOT1Value"
            />
            <p>
              LOT Shipment Date:
              <input
                id="LOT1ShipmentDate"
                name="LOT1ShipmentDate"
                label="LOT1ShipmentDate"
                placeholder="LOT1ShipmentDate"
                type="date"
                value={
                  lOT1ShipmentDate.getFullYear().toString() +
                  "-" +
                  (lOT1ShipmentDate.getMonth() + 1).toString().padStart(2, 0) +
                  "-" +
                  lOT1ShipmentDate.getDate().toString().padStart(2, 0)
                }
                onChange={(e) => {
                  setLOT1ShipmentDate(new Date(e.target.value));
                  preshipmentFacilitys.LOT1ShipmentDate = lOT1ShipmentDate;
                }}
              />{" "}
            </p>
            <p>
              LOT Disbursement Date:
              <input
                id="LOT1DisbursementDate"
                name="LOT1DisbursementDate"
                label="LOT1DisbursementDate"
                placeholder="LOT1DisbursementDate"
                type="date"
                value={
                  LOT1DisbursementDate.getFullYear().toString() +
                  "-" +
                  (LOT1DisbursementDate.getMonth() + 1)
                    .toString()
                    .padStart(2, 0) +
                  "-" +
                  LOT1DisbursementDate.getDate().toString().padStart(2, 0)
                }
                onChange={(e) => {
                  setLOT1DisbursementDate(new Date(e.target.value));
                  preshipmentFacilitys.OT1DisbursementDate =
                    lOT1DisbursementDate;
                }}
              />{" "}
            </p>
            <LoanTextField
              id="LOT1DisbursementAmount"
              label="LOT1DisbursementAmount"
              value={preshipmentFacilitys.LOT1DisbursementAmount}
              onChange={handleInputChangePreshipmentFacility}
              name="LOT1DisbursementAmount"
            />
            {/* IsLOT1ShipmentMade */}
            <FormControl variant="standard" sx={{ minWidth: 120 }}>
              <InputLabel id="IsLOT1ShipmentMade" color="secondary">
                IsLOT1ShipmentMade{" "}
              </InputLabel>
              <Select
                color="secondary"
                onChange={(event) => {
                  preshipmentFacilitys.IsLOT1ShipmentMade = event.target.value;
                  // setLoanTypeId(event.target.value);
                }}
                labelId="IsLOT1ShipmentMade"
                id="IsLOT1ShipmentMade"
                label="IsLOT1ShipmentMade"
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                <MenuItem value="1">
                  <em>yes</em>
                </MenuItem>
                <MenuItem value="0">
                  <em>No</em>
                </MenuItem>
              </Select>
            </FormControl>
            <p>
              LOT Incoming Date:
              <input
                id="LOT1IncomingDate"
                name="LOT1IncomingDate"
                label="LOT1IncomingDate"
                placeholder="LOT1IncomingDate"
                type="date"
                value={
                  LOT1IncomingDate.getFullYear().toString() +
                  "-" +
                  (LOT1IncomingDate.getMonth() + 1).toString().padStart(2, 0) +
                  "-" +
                  LOT1IncomingDate.getDate().toString().padStart(2, 0)
                }
                onChange={(e) => {
                  setLOT1IncomingDate(new Date(e.target.value));
                  preshipmentFacilitys.LOT1IncomingDate = LOT1IncomingDate;
                }}
              />{" "}
            </p>
            <LoanTextField
              id="LOT1ProceedValue"
              label="LOT1ProceedValue"
              value={preshipmentFacilitys.LOT1ProceedValue}
              onChange={handleInputChangePreshipmentFacility}
              name="LOT1ProceedValue"
            />
            {/* LOT1CurrencyId */}
            <FormControl variant="standard" sx={{ minWidth: 120 }}>
              <InputLabel id="LoanTypeId" color="secondary">
                LOT Currency{" "}
              </InputLabel>
              <Select
                color="secondary"
                onChange={(event) => {
                  preshipmentFacilitys.LOT1CurrencyId = event.target.value;
                  // setCurrencyId(event.target.value);
                }}
                labelId="CurrencyId"
                id="CurrencyId"
                label="CurrencyId"
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                {currency.map((yourCurrency) => (
                  <MenuItem
                    key={yourCurrency.Id}
                    CurrencyId={yourCurrency.Id}
                    value={yourCurrency.Id}
                  >
                    {yourCurrency.Name}
                  </MenuItem>
                ))}
              </Select>
