              </InputLabel>
              <Select
                color="secondary"
                onChange={(event) => {
                  preshipmentFacilitys.IsProceedSettledDisbursementAmount =
                    event.target.value;
                  // setLoanTypeId(event.target.value);
                }}
                labelId="IsProceedSettledDisbursementAmount"
                id="IsProceedSettledDisbursementAmount"
                label="IsProceedSettledDisbursementAmount"
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                <MenuItem value="1">
                  <em>yes</em>
                </MenuItem>
                <MenuItem value="0">
                  <em>No</em>
                </MenuItem>
              </Select>
            </FormControl>
            {/* IsThereProceedRemainedToBeCollected */}
            <FormControl variant="standard" sx={{ minWidth: 120 }}>
              <InputLabel
                id="IsThereProceedRemainedToBeCollected"
                color="secondary"
              >
                IsThereProceedRemainedToBeCollected{" "}
              </InputLabel>
              <Select
                color="secondary"
                onChange={(event) => {
                  preshipmentFacilitys.IsThereProceedRemainedToBeCollected =
                    event.target.value;
                  // setLoanTypeId(event.target.value);
                }}
                labelId="IsThereProceedRemainedToBeCollected"
                id="IsThereProceedRemainedToBeCollected"
                label="IsThereProceedRemainedToBeCollected"
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                <MenuItem value="1">
                  <em>yes</em>
                </MenuItem>
                <MenuItem value="0">
                  <em>No</em>
                </MenuItem>
              </Select>
            </FormControl>
            {/* IsCustomerPresentedNewContractForAmendment */}
            <FormControl variant="standard" sx={{ minWidth: 120 }}>
              <InputLabel
                id="IsCustomerPresentedNewContractForAmendment"
                color="secondary"
              >
                IsCustomerPresentedNewContractForAmendment{" "}
              </InputLabel>
              <Select
                color="secondary"
                onChange={(event) => {
                  preshipmentFacilitys.IsCustomerPresentedNewContractForAmendment =
                    event.target.value;
                  // setLoanTypeId(event.target.value);
                }}
                labelId="IsCustomerPresentedNewContractForAmendment"
                id="IsCustomerPresentedNewContractForAmendment"
                label="IsCustomerPresentedNewContractForAmendment"
              >
                <MenuItem value="">
                  <em>None</em>
                </MenuItem>
                <MenuItem value="1">
                  <em>yes</em>
                </MenuItem>
                <MenuItem value="0">
                  <em>No</em>
                </MenuItem>
              </Select>
            </FormControl>
            <LoanTextField
              id="TurnOver"
              label="TurnOver"
              value={preshipmentFacilitys.TurnOver}
              onChange={handleInputChangePreshipmentFacility}
              name="TurnOver"
            />
            <LoanTextField
              id="NextAction"
              label="NextAction"
              value={preshipmentFacilitys.NextAction}
              onChange={handleInputChangePreshipmentFacility}
              name="NextAction"
            />
          </div>
          <div className="flex justify-center p-2 pt-5">
            <button
              className="bg-[purple] hover:bg-purple-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
              onClick={() => {
                savePreshipmentFacility();
              }}
            >
              Save
            </button>
          </div>
        </div>
      </CompanyModal>
    </>
  );
};
